control.onControlLoad:
g5.log = function(value) {
    var c = ee.getControl("divRoot");
    ee.setText(c, ee.getText(c) + value + "</br>");
}

g5.initMouse = function (c) {
    if ("ontouchstart" in window) {
        eb.addEvent(c, "touchstart", function (event) {
            var sender = event.target ? event.target : (event.srcElement ? event.srcElement : null);
            if (sender == null) return;
            g5.log("touchstart:" + this.id);        
        }, false);
        eb.addEvent(c, "touchend", function (event) {
            var sender = event.target ? event.target : (event.srcElement ? event.srcElement : null);
            if (sender == null) return;
            g5.log("touchend:" + this.id);        
        }, false);
        eb.addEvent(c, "touchmove", function (event) {
            var sender = event.target ? event.target : (event.srcElement ? event.srcElement : null);
            if (sender == null) return;
            g5.log("touchmove:" + this.id);        
        }, false);
    }
}

g5.initMouse(ee.getControl("panel1"));
